import React, {useState} from "react";
import { Link } from "react-router-dom";
import { HomeIcon, AccountIcon, MessageIcon } from "mdi-react";
import { css } from "emotion";

//{}

const Header = props => {
  const [logOutButton, setLogOutButton] = useState(false);

  return (
    <>
    <header className={container()}>
      <div>
        <Link to="/">
          <HomeIcon />
          <span>Home</span>
        </Link>
      </div>
      <div>
        <Link to="/account">
          <AccountIcon />
          <span>Account</span>
        </Link>
      </div>
      <div>
        <Link to="/messages">
          <MessageIcon />
          <span>Messages</span>
        </Link>
      </div>
      {props.account && (
        <div className="profile">
          <AccountIcon /> {props.account}
        </div>
      )}
    </header>
    <nav classname="right">
        <div>
          Logout
        </div>
    </nav>
    </>
  );
};

const container = () => css`
  header {
    display: flex;
  }
  
  .profile {
    display: flex;
    align-items: center;
    margin-left: auto;
  }
`;

export default Header;
